	/**
	 * @see HttpServlet#doPost(HttpServletRequest request, HttpServletResponse
	 *      response)
	 */
	protected void doPost(HttpServletRequest request, HttpServletResponse response)
			throws ServletException, IOException {
		// TODO Auto-generated method stub
//		doGet(request, response);

		response.addHeader("Access-Control-Allow-Origin", "*");
		response.addHeader("Access-Control-Allow-Method", "POST, GET, UPDATE, OPTIONS, DELETE");
		response.setCharacterEncoding("UTF-8");

		String jsonBody = new BufferedReader(new InputStreamReader(request.getInputStream())).lines()
				.collect(Collectors.joining("\n"));

//		System.out.println(jsonBody);

		JSONObject jsonReq = new JSONObject(jsonBody);
//		System.out.println(jsonReq);

		Session session = HibernateUtils.getSession();

		Transaction transaction = session.beginTransaction();

		JSONObject respObject = new JSONObject();

		PrintWriter writer = response.getWriter();

		if (jsonReq.getString("packetType").equalsIgnoreCase("ACTIVE_TEMPLE")) {

			String mobileNo = jsonReq.getString("mobileNo");
			String passcode = jsonReq.getString("passcode");
			String terminalID = jsonReq.getString("terminalID");
			String locationID = jsonReq.getString("locationId");
			String lockerNo = jsonReq.getString("lockerNo");

			try {
				String hql = "FROM TransactionDetails WHERE mobileNo = :mobileno AND terminalid=:terminalId";

				ArrayList<TransactionDetails> templeLockerDetailsActiveList = (ArrayList<TransactionDetails>) session
						.createQuery(hql).setParameter("mobileno", mobileNo).setParameter("terminalId", terminalID)
						.getResultList();

				transaction.commit();

				if (!templeLockerDetailsActiveList.isEmpty()) {

					for (TransactionDetails transactionDetails : templeLockerDetailsActiveList) {
						respObject.put("responseCode", "status-200");
//						respObject.put("packetType", "ACTIVE_TEMPLE");
						respObject.put("LOCKNO", transactionDetails.getLockNo());
						respObject.put("terminalID", transactionDetails.getTerminalid());
						respObject.put("MobileNo", transactionDetails.getMobileNo());
						respObject.put("DOB", transactionDetails.getDateofbirth());
						respObject.put("img", imgByteArr);
						break;
					}

				} else {
					respObject.put("responseCode", "status-404");
				}

			} catch (NoResultException ex) {
				respObject.put("responseCode", "status-404");
			} catch (Exception e) {
				// TODO: handle exception
				respObject.put("responseCode", "status-500");
				e.printStackTrace();
			} finally {
				if (session != null) {
					session.close();
				}
			}

		}

		writer.append(respObject.toString()).flush();
	}

